import React from 'react'
import { useNavigate } from 'react-router-dom'

import OutlinedInput from '@mui/material/OutlinedInput';

import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
export const Register = () => {

    const navigate = useNavigate()

    return (
        <div>
            <h1>Register</h1>
            <OutlinedInput placeholder="Name" /><br /> <br />
            <OutlinedInput placeholder="Email" /><br /> <br />
            <OutlinedInput placeholder="Password" /><br /> <br />
            <OutlinedInput placeholder="Mobile no." /><br /> <br />


            <Stack spacing={2} direction="row">
                <Button variant="contained">Register</Button>
                <Button variant="contained" onClick={() => navigate("/login")}>Register</Button>
            </Stack>
            {/* 
            <input type="text" placeholder="Name" /><br /><br />
            <input type="text" placeholder="Email" /><br /><br />
            <input type="text" placeholder="Password" /><br /><br />
            <input type="number" placeholder="Mobile No." /><br /><br />
            <button>Register</button>
            <button onClick={() => navigate("/login")}>login</button> */}
        </div>
    )
}
